import React from 'react';

const todos =[
    {
        id: 1,
        name: 'Have some exercise',
        completed: true
    },
    {
        id: 2,
        name: 'Meet a therapist',
        completed: false
    },
    {
        id: 3,
        name: 'Go to the eatery',
        completed: false
    },
    {
        id: 4,
        name: 'Go to the bank',
        completed: true
    }
]
export default todos;
